import { useState, useEffect } from "react";
export default function Vans() {

  const [vans, setVans] = useState([]);
  useEffect(() => {
    fetch('/api/vans')
    .then(data => data.json())
    .then(result => setVans(result));
  }, []);

  return (
    <main className="vans-container">
        <section>
            <h1>Vans page goes here</h1>
        </section>
    </main>
  );
};
